def generate_permutations(inputs):
    n = len(inputs)
    used = [False] * n
    current = [None] * n

    def backtrack(pos):
        if pos == n:
            yield list(current)
            return
        for i in range(n):
            if not used[i]:
                used[i] = True
                current[pos] = inputs[i]
                yield from backtrack(pos + 1)
                used[i] = False

    return backtrack(0)


