from cachetools import LRUCache, cached

def lru_memoize(maxsize: int = 128):
    """Memoization decorator with an LRU eviction policy."""
    cache = LRUCache(maxsize)

    def decorator(func):
        @functools.wraps(func)
        def wrapper(*args, **kwargs):
            # cachetools.cached works with positional arguments only,
            # so we combine args and kwargs into a single hashable key.
            key = args + tuple(sorted(kwargs.items()))
            return cached(cache, key=key)(func)(*args, **kwargs)
        return wrapper
    return decorator


